import React from 'react';
import { Link } from 'react-router-dom';

const DashboardPage: React.FC = () => {
  return (
    <div className="min-h-screen bg-[#0a0a0a] text-white">
      {/* Header */}
      <div className="w-full border-b border-gray-800">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-8">
          <div className="flex flex-col items-center justify-center relative">
            <Link 
              to="/"
              className="absolute left-0 text-[#00d9ff] hover:text-white transition-colors duration-300"
            >
              ‚Üê Back
            </Link>
            <h1 className="text-4xl sm:text-5xl md:text-6xl font-bold text-center">
              Story Dashboard
            </h1>
          </div>
        </div>
      </div>

      {/* Main Content */}
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-12">
        <div 
          className="story-container rounded-2xl backdrop-blur-sm
                     border-2 border-[#ff69b4] bg-[rgba(20,20,23,0.95)]
                     min-h-[600px] w-full"
        >
          {/* Future story posts will go here */}
        </div>
      </div>
    </div>
  );
};

export default DashboardPage;
